  if(atr_n != null){
    return (
      <Container side={'right'} w={'25vw'} h={'25vh'} min_w={'12vw'} min_h={'25vh'}> 
        <div>
          <h3>{atr_n}</h3>
          <UL>
            <ul>
              {legend?.map(repo =>{
                return(
                  <Li color={repo.color} key={repo.atr}>
                   <button style={{"border":"none", }} className="btn"> {repo.atr} </button>
                  </Li>
                )
              })}
            </ul>
            </UL>
            </div>
        </Container>
    )
  }else{
    return(
      <div></div>
    )
  }
}
